Language.admin.alert_max_characters={message:"Maximum 500 characters"};Language.admin.live_answering_introduction={vars:["lineStart","lineEnd"],message:"#lineStart Live chat has proven to increase leads, inquiries and overall customer satisfaction - but often, the biggest challenge businesses face is how to hire staff to ensure you're always online when your customers need you. #lineEnd#lineStartIn an increasingly 24x7 world, your website doesn't close - so customers expect someone to be there when they have a question. #lineEnd"};
Language.admin.live_answering_details_header={message:"We staff your site 24/7, create a personal connection, and drive more leads & sales"};Language.admin.live_answering_details_just_one_hour={vars:["lineStart","lineEnd","bigTextStart","bigTextEnd"],message:"#lineStart#bigTextStart Just $1 / hour #bigTextEnd#lineEnd#lineStart Pay as little as $1 per hour for PRO, heavily trained agents. Our rates simply can\u2019t be beat! #lineEnd"};
Language.admin.live_answering_details_24_7_365={vars:["lineStart","lineEnd","bigTextStart","bigTextEnd"],message:"#lineStart#bigTextStart 24/7-365 #bigTextEnd#lineEnd#lineStart We don\u2019t ever close, which means your customers get great service, every single day of the year. #lineEnd"};Language.admin.live_answering_details_real_humans={vars:["lineStart","lineEnd","bigTextStart","bigTextEnd"],message:"#lineStart#bigTextStart Real Humans #bigTextEnd#lineEnd#lineStart No bots with thoughtless answers. We only hire real humans, trained to be customer service experts. #lineEnd"};
Language.admin.live_answering_details_better_leads={vars:["lineStart","lineEnd","bigTextStart","bigTextEnd"],message:"#lineStart#bigTextStart Better Leads #bigTextEnd#lineEnd#lineStart Highly qualified leads - That\u2019s what our expert agents can deliver, resulting in better Advertising ROI. #lineEnd"};Language.admin.live_answering_details_crm_integration={vars:["lineStart","lineEnd","bigTextStart","bigTextEnd"],message:"#lineStart#bigTextStart CRM Integrations #bigTextEnd#lineEnd#lineStart You have full access to chat history in real time, and we can integrate with any existing CRM API. #lineEnd"};
Language.admin.live_answering_details_native_speakers={vars:["lineStart","lineEnd","bigTextStart","bigTextEnd"],message:"#lineStart#bigTextStart Native Speakers #bigTextEnd#lineEnd#lineStart English? Italian? German? French? Spanish? Our team of native speakers, speak your customers language. #lineEnd"};Language.admin.live_answering_details_description={vars:["lineStart","lineEnd"],message:'#lineStart Hiring live agents with tawk.to is "Your business, powered by our support team". Your customers will think they are chatting with your in house staff, right on your website. #lineEnd#lineStart Nothing is worse for a visitor than when they can\'t find what they are looking for on your website.&nbsp;The visitor may simply need to ask a quick question before making a purchase decision, and nobody is there to help.&nbsp;Our dedicated, native speaking experts are fully trained in customer service and lead capture and can assist and guide your visitors when they need help right away. #lineEnd'};
Language.admin.faqs={message:"FAQs"};Language.admin.live_answering_faqs_content_1={vars:["lineStart","lineEnd","questionStart","questionEnd"],message:"#questionStart#lineStart How does the Hire Live Agents add-on work? #lineEnd#questionEnd#lineStart Prior to allocating Live Agents to your project, we undertake a full audit of your requirements & any systems or processes we need to put in place to ensure we best represent you and your company. #lineEnd#lineStart We have developed a process to help us collate all the information agents will need to answer the queries of your website's visitors correctly and efficiently; please do take some time to go through the questions and provide detailed answers to each. The more information we have, the better equipped we will be to service your website visitors. #lineEnd"};
Language.admin.live_answering_faqs_content_2={vars:["lineStart","lineEnd","questionStart","questionEnd"],message:"#questionStart#lineStart Why should I hire tawk.to agents to answer chats from my website? #lineEnd#questionEnd#lineStart Many businesses don't have the staff available to have a real live person ready and available to answer incoming chats at all hours of the day. When you hire our team of highly trained chat agents your visitors will be able to chat live with a real live person when you or your staff are unavailable. You can have our agents answer all incoming chats or use our agents only when your staff is unavailable to answer. You set the schedule and we follow it! #lineEnd"};
Language.admin.live_answering_faqs_content_3={vars:"lineStart lineEnd questionStart questionEnd listStart listEnd newLineList endLineList".split(" "),message:"#questionStart#lineStart What is the pricing for hiring live chat agents? #lineEnd#questionEnd#listStart#newLineList $1 an hour - 24X7-365 (168 hours a week) - $728/month #endLineList#newLineList $1.10 an hour - Evenings and Weekends (128 hours a week) - $610/month #endLineList#newLineList $1.50 an hour - Double-Shift (80 hours a week) - $520/month #endLineList#newLineList $2.20 an hour - Full-time (40 hours a week) - $380/month #endLineList#newLineList $3.00 an hour - Part-time (10 hours a week) - $129/month #endLineList#listEnd"};
Language.admin.live_answering_faqs_content_4={vars:["lineStart","lineEnd","questionStart","questionEnd"],message:"#questionStart#lineStart Why is the pricing for hiring live chat agents so inexpensive? #lineEnd#questionEnd#lineStart We are able to offer pricing as low as $1 an hour because one agent can answer several chats from multiple companies at the same time. This is what keeps our pricing so low. You are sharing the cost of hiring a live chat agent with other companies also using the service. #lineEnd"};
Language.admin.live_answering_faqs_content_5={vars:["lineStart","lineEnd","questionStart","questionEnd"],message:"#questionStart#lineStart How many chats will you accept from my website at the same time? #lineEnd#questionEnd#lineStart Our agents will answer up to 2 concurrent chats at a time. #lineEnd"};Language.admin.live_answering_faqs_content_6={vars:["lineStart","lineEnd","questionStart","questionEnd"],message:"#questionStart#lineStart How are your agents trained to be able to answer questions from my visitors about my products or services? #lineEnd#questionEnd#lineStart During the signup process you will be asked to provide information about your business. Think of it as FAQ's. You tell us what type of questions we can expect from your website visitors and provide the answers to those questions. #lineEnd#lineStart Our project managers will review your website and add any information we find pertinent to your business or service offering to the knowledge base. The knowledge base is basically a database of information about your business or service. This information is available to any agent that answers an incoming chat from your site. #lineEnd#lineStart This is an ongoing process. All of our agents are trained to add any additional information they learn about your business or service to your knowledge base. Typically within 5 to 10 days of starting the service our agents can answer most questions easily. #lineEnd"};
Language.admin.live_answering_faqs_content_7={vars:["lineStart","lineEnd","questionStart","questionEnd"],message:'#questionStart#lineStart What if the tawk.to agents are unable to answer my customers question? #lineEnd#questionEnd#lineStart There will be times when our agents won\'t know the answer to a question being asked and we will need more information from you or your team. #lineEnd#lineStart In these cases our agents are trained to get the name, email and phone number from the visitor and explain to them that we will follow up with them as soon as possible regarding their question or issue. #lineEnd#lineStart If the issue is urgent we will contact you right away using the contact information you provided when signing up for the service. We can then add any information we learn during this process to the knowledge base for your site. #lineEnd#lineStart In the future if the same issue or question arises our agents will be prepared with the proper answer. Our agents are trained to get the correct information to your visitors. We never "guess" the answer. #lineEnd'};
Language.admin.live_answering_faqs_content_8={vars:["lineStart","lineEnd","questionStart","questionEnd"],message:"#questionStart#lineStart Can I chat with my website vistors when the tawk.to agents are scheduled to be answering chats? #lineEnd#questionEnd#lineStart Yes of course! You can chat with your website visitors and our agents through the tawk.to dashboard. You can even monitor our agents performance in the tawk.to dashboard as they service your visitors. #lineEnd"};
Language.admin.live_answering_faqs_content_9={vars:["lineStart","lineEnd","questionStart","questionEnd"],message:"#questionStart#lineStart Where do I see messages from visitors the tawk.to agents have had chats with? #lineEnd#questionEnd#lineStart You can view all chat transcripts and messages in the tawk.to dashboard. You can even have all chat transcripts emailed to you directly after a chat has ended. #lineEnd#lineStart Just login to http://localhost/frank/pickeringToyota/tawt/dashboard.php and click messaging at the top of the dashboard. If our agents feel a message is urgent we will contact you right away. #lineEnd"};
Language.admin.live_answering_faqs_content_10={vars:["lineStart","lineEnd","questionStart","questionEnd"],message:"#questionStart#lineStart What hours are the live chat agents available? #lineEnd#questionEnd#lineStart Our agents are always available to answer chats on your behalf. We never close. We provide live answering services 24 hours a day, 7 days a week, 365 days a year. #lineEnd"};Language.admin.live_answering_faqs_content_11={vars:["lineStart","lineEnd","questionStart","questionEnd"],message:"#questionStart#lineStart Do I have to sign a contract? #lineEnd#questionEnd#lineStart No. You pay for the service on a monthly basis. There are no lengthy contracts to sign. #lineEnd"};
Language.admin.live_answering_faqs_content_12={vars:["lineStart","lineEnd","questionStart","questionEnd"],message:"#questionStart#lineStart Do you charge for lead capturing?#lineEnd#questionEnd#lineStart No we never charge you for capturing a sales lead. We don't charge on a per lead basis. #lineEnd"};Language.admin.live_answering_faqs_content_13={vars:["lineStart","lineEnd","questionStart","questionEnd"],message:"#questionStart#lineStart Where are your chat agents based out of? #lineEnd#questionEnd#lineStart Tawk.to is registered in the USA and United Kingdom. #lineEnd#lineStart We are a distributed team with R&D offices in Riga, Latvia (European Union) and Las Vegas, Nevada; with remote team members in Australia, Italy and the Philippines. #lineEnd"};
Language.admin.live_answering_faqs_content_14={vars:["lineStart","lineEnd","questionStart","questionEnd"],message:"#questionStart#lineStart What languages do your agents speak? #lineEnd#questionEnd#lineStart During the beta period we will only be offering live answering in English. We will be adding more languages in the near future however. #lineEnd"};Language.admin.live_answering_faqs_content_15={vars:["lineStart","lineEnd","questionStart","questionEnd","link"],message:"#questionStart#lineStart If I\u2019m not happy with the service can I cancel for a full refund? #lineEnd#questionEnd#lineStart Due to the amount of training involved in setting up a new client for our live answering services we are unable to offer refunds. #lineEnd#lineStart If you wish to cancel the service please send your request to #link and we will cancel the service prior to your next billing date. #lineEnd"};
