Language.admin.webrtc_legal_question={vars:["lineStart","lineEnd","questionStart","questionEnd"],message:"#questionStart This is where we tell you the stuff that our legal people tell us we have to tell you : #questionEnd#lineStart tawk.to can not guarantee that the service will always function without disruptions, delay or errors. A number of factors may impact the quality of Video and Audio casting services, and may result in the failure of your communication, including but not limited to: Network speeds, your ISP, your local network, Firewalls, your power suply. Tawk.to takes no responsability for any disruption, interruption or delay caused by any failure or inadequacy in any of these items or any other items over which we have no control. So be cool, and tell us if you experience any issues ok? #lineEnd#lineStart We promise to do our best to fix things that are in our control, and you promise to be cool about the things that are completely out of our control. #lineEnd"};
